import logo from './logo.svg';
import './App.css';

function App() 
{
  function handleSubmit(e) 
  {
    e.preventDefault();
    console.log('You clicked submit.');
  }




  return (
    <div className="App">

      <button onClick={handleSubmit}>
        Activate Lasers
      </button>


    </div>
  );
}

export default App;
